describe('round_trip_pkarm', () => {
    test('test_round_trip_pkarm', async () => {
        console.log('Compiling EthVerifier.');

        const vk = (
            await EthVerifier.compile({
                forceRecompile: true,
            })
        ).verificationKey;
        const ethVerifierVkHash = vk.hash.toString();
        console.log(
            `EthVerifier contract compiled vk: '${ethVerifierVkHash}'.`
        );

        const result = await computeDepositAttestationWitnessAndEthVerifier(
            4420220,
            '0xC7e910807Dd2E3F49B34EfE7133cfb684520Da69'.toLocaleLowerCase(),
            '0x1e8d7e09881f7bc2309d93feec6cbb5503cc5b48be8f648c9be8f656b4b1ef95'
        );

        console.log(
            result.depositAttestationInput,
        );
        // 14186471461218842232009479137007348822514964693644461481574228383548423138379 this is the little endian root // verifiedContractDepositsRoot
        // Big-endian: 34340701770472703196160360647775668588768322300301410067403935261219491044639 this is the big endian root 
        // 

        const ret2 = await getContractDepositSlotRootFromContractDepositAndWitness(buildMerkleTreeContractDepositAttestorInput(result.depositAttestationInput));
    });
});

